import React from "react";
import Template from "../mainTemplate.js";
import ResizeBC from "../../components/ResizeBC";
import {
  PaddingContainer,
  LatinText
} from "../../components/SpacingComponents";

const Resize2 = () => (
  <Template
    title="Grow/Shrink | Bounding Client"
    description="Resize component with bounding client..."
  >
    <LatinText />
    <ResizeBC grow={true} />
    <PaddingContainer />
    <ResizeBC grow={false} />
    <PaddingContainer />
    <ResizeBC grow={true} />
    <PaddingContainer height="500px" />
  </Template>
);

export default Resize2;
